(1, '{\"title\":\"My Multi Step Form\",\"steps\":[{\"title\":\"Step 1\",\"headline\":\"\",\"copy_text\":\"\",\"parts\":[{\"title\":\"Step 1\",\"blocks\":[{\"type\":\"text\",\"label\":\"Name\",\"required\":\"true\"},{\"type\":\"date\",\"label\":\"Date\",\"format\":\"yy-mm-dd\",\"required\":\"true\"},{\"type\":\"numeric\",\"label\":\"Mobile Number\",\"required\":\"true\",\"minimum\":\"\",\"maximum\":\"\"},{\"type\":\"email\",\"label\":\"Email Id\",\"required\":\"true\"},{\"type\":\"date\",\"label\":\"Date of Birth\",\"format\":\"yy-mm-dd\",\"required\":\"false\"},{\"type\":\"numeric\",\"label\":\"Age\",\"required\":\"true\",\"minimum\":\"1\",\"maximum\":\"100\"},{\"type\":\"text\",\"label\":\"Height\",\"required\":\"true\"},{\"type\":\"numeric\",\"label\":\"Weight\",\"required\":\"true\",\"minimum\":\"4\",\"maximum\":\"140\"},{\"type\":\"text\",\"label\":\"In Case of Emergency Contact\",\"required\":\"false\"},{\"type\":\"text\",\"label\":\"Relationship\",\"required\":\"false\"},{\"type\":\"text\",\"label\":\"Address\",\"required\":\"false\"}]}]},{\"title\":\"Step 2\",\"headline\":\"\",\"copy_text\":\"\",\"parts\":[{\"title\":\"MEDICAL HISTORY REVIEW FORM\",\"blocks\":[{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Are you currently under a doctor\\u2019s care\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"text\",\"label\":\"If yes, explain\",\"required\":\"false\"},{\"type\":\"text\",\"label\":\"When was the last time you had a physical examination?\",\"required\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Have you ever had an exercise stress test\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"},{\"type\":\"option\",\"value\":\"Don\\u2019t Know\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"If yes, were the results\"},{\"type\":\"option\",\"value\":\"Normal\"},{\"type\":\"option\",\"value\":\"Abnormal\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Do you take any medications on a regular basis?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"text\",\"label\":\"If yes, please list medications and reasons for taking\",\"required\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Have you been recently hospitalized?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"text\",\"label\":\"If yes, explain\",\"required\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Do you smoke?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Are you pregnant?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Do you drink alcohol more than three times\\/week?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Is your stress level high?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Are you moderately active on most days of the week?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"High blood pressure?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"High cholesterol?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Diabetes?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Have parents or siblings who, prior to age 55 had\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"A heart attack?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"A stroke?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"High blood pressure?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"High cholesterol?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Known heart disease?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Rheumatic heart disease?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"A heart murmur?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Chest pain with exertion?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Irregular heart beat or palpitations?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Lightheadedness or do you faint?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Unusual shortness of breath?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Cramping pains in legs or feet?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Emphysema?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Other metabolic disorders (thyroid, kidney, etc.)?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Epilepsy?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Asthma?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Back pain: upper, middle, lower?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Other joint pain (explain on back of form)?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"NO\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"Muscle pain or an injury (explain on back of Form)?\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"radio\",\"elements\":[{\"type\":\"header\",\"value\":\"To the best of my knowledge, the above information is true.\"},{\"type\":\"option\",\"value\":\"Yes\"},{\"type\":\"option\",\"value\":\"No\"}],\"required\":\"true\",\"multichoice\":\"false\"},{\"type\":\"text\",\"label\":\"Sign Name (Type your name):\",\"required\":\"true\"}]}]}],\"settings\":{\"thankyou\":\"http:\\/\\/[multi-step-form%20id=1]\",\"to\":\"hr@kanvan.in\",\"frommail\":\"hr@kanvan.in\",\"fromname\":\"kanvan\",\"subject\":\"steps\",\"header\":\"\",\"headers\":\"\",\"replyto\":\"no-reply\",\"usercopy\":\"no-usercopy\",\"optin\":\"no-optin\",\"optin_success\":\"\",\"replacements\":\"off\"}}', '1.7.0', '2020-10-06 14:04:23');
