(1047, 48, 'default', '<p class=\"MsoBodyText\" style=\"margin-top:11.35pt;margin-right:40.1pt;margin-bottom:\n0in;margin-left:5.55pt;margin-bottom:.0001pt\"><br><!--[if gte mso 9]><xml>\n <o:DocumentProperties>\n  <o:Version>14.00</o:Version>\n </o:DocumentProperties>\n <o:OfficeDocumentSettings>\n  <o:AllowPNG></o:AllowPNG>\n </o:OfficeDocumentSettings>\n</xml><![endif]-->Congratulations on your decision\nto improve your health by participating in a professional exercise program!</p><p class=\"MsoBodyText\" style=\"margin-top:11.35pt;margin-right:40.1pt;margin-bottom:\n0in;margin-left:5.55pt;margin-bottom:.0001pt\"><br></p><p class=\"MsoBodyText\" style=\"margin-top:0in;margin-right:22.85pt;margin-bottom:\n0in;margin-left:5.55pt;margin-bottom:.0001pt\">With the help of our Fitness\ntrainer, you greatly improve your ability to accomplish your training goals\nfaster, safer, and with maximum benefits. The education you will learn during\nthese training sessions can be used for a lifetime.</p><p class=\"MsoBodyText\" style=\"margin-top:0in;margin-right:22.85pt;margin-bottom:\n0in;margin-left:5.55pt;margin-bottom:.0001pt\"><br></p><p class=\"MsoBodyText\" style=\"margin-top:0in;margin-right:22.85pt;margin-bottom:\n0in;margin-left:5.55pt;margin-bottom:.0001pt\"><!--[if gte mso 9]><xml>\n <o:DocumentProperties>\n  <o:Version>14.00</o:Version>\n </o:DocumentProperties>\n <o:OfficeDocumentSettings>\n  <o:AllowPNG></o:AllowPNG>\n </o:OfficeDocumentSettings>\n</xml><![endif]--><!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves></w:TrackMoves>\n  <w:TrackFormatting></w:TrackFormatting>\n  <w:PunctuationKerning></w:PunctuationKerning>\n  <w:ValidateAgainstSchemas></w:ValidateAgainstSchemas>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF></w:DoNotPromoteQF>\n  <w:LidThemeOther