(2176, 'frm_addons_l', 'a:3:{s:7:\"timeout\";i:1602088983;s:5:\"value\";s:79086:\"{\"20790298\":{\"title\":\"Active Campaign\",\"name\":\"Active Campaign\",\"slug\":\"activecampaign-wordpress-plugin\",\"version\":\"1.06\",\"new_version\":\"1.06\",\"location\":[\"fp.strategy11.com\\/releases\\/activecampaign\\/formidable-activecampaign-1.06.zip\"],\"excerpt\":\"Add contacts to any ActiveCampaign list from your WordPress forms.\",\"id\":20790298,\"released\":\"2018-07-05 00:00:00\",\"categories\":[\"Elite\",\"Marketing\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/activecampaign-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/activecampaign-wordpress-plugin\\/\",\"changelog\":\"\",\"plugin\":\"formidable-activecampaign\\/formidable-activecampaign.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"337527\":{\"title\":\"Authorize.net AIM\",\"name\":\"Authorize.net AIM\",\"slug\":\"authorize-net-aim\",\"version\":\"2.01\",\"new_version\":\"2.01\",\"location\":[\"fp.strategy11.com\\/releases\\/authorize-net\\/formidable-authorize-net-2.01.zip\"],\"excerpt\":\"Accept one-time payments directly on your site, using Authorize.net AIM.\",\"id\":337527,\"released\":\"2016-04-29 00:00:00\",\"categories\":[\"Ecommerce\",\"Elite\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/authorize-net-aim\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/authorize-net-aim\\/\",\"changelog\":\"<h4>v2.01 - March 18, 2019<\\/h4>\\n<ul>\\n<li>Fix: Increase the timeout for creating the payment on Authorize.net in order to prevent false failures.<\\/li>\\n<li>Save the full API response in the log instead of only the body of the response for more helpful debugging messages.<\\/li>\\n<\\/ul>\\n<h4>v2.0 - February 25, 2019<\\/h4>\\n<ul>\\n<li>Requires Formidable 3.0+ and WordPress 4.7+<\\/li>\\n<li>New: Remove the Authorize.net SDK. This greatly reduces the size of the plugin, and resolves PHP 7.0+ compatibility issues.<\\/li>\\n<li>New: Use Webhooks to get notifications from Authorize.net to a REST endpoint when a payment status changes. This includes refunds, voids, and completed transactions. A webhook will be automatically created when the Formidable -&gt; Global settings page is saved.<\\/li>\\n<li>New: Added signature key to Global settings page and removed the Silent Post url. This is used to verify any incoming webhooks.<\\/li>\\n<li>New: Don\'t use MD5 verification, but meet the new sha512 requirement instead.<\\/li>\\n<li>New: Add Bangladeshi Taka currency<\\/li>\\n<li>Fix: Replace usage of deprecated file and functions from Formidable<\\/li>\\n<li>Fix: Added escaping for translatable strings.<\\/li>\\n<\\/ul>\\n<h4>v1.02 - August 31, 2018<\\/h4>\\n<ul>\\n<li>New: Delete entries that don\'t pass credit card validation<\\/li>\\n<li>New: Process shortcodes in the payment amount, description, and actions after payment. This includes default values, field values, and regular WP shortcodes.<\\/li>\\n<li>New: Allow the api key to be overridden with constants. The Authorize account can be set with AUTHORIZENET_TRANSACTION_KEY and AUTHORIZENET_API_LOGIN_ID<\\/li>\\n<li>New: Disable live mode for non-ssl sites. Show the settings and always allow test mode.<\\/li>\\n<li>New: Add option to register user after successful payment<\\/li>\\n<li>New: Add payment triggers to api action<\\/li>\\n<li>New: Add receipt ID shortcode<\\/li>\\n<li>New: Add Pakistani rupee, Chinese Renminbi Yuan, South African Rand, and Sri Lankan Rupee to currency options<\\/li>\\n<li>New: If PayPal is also installed, show the PayPal payment completed status<\\/li>\\n<li>New: Add frm_pay_[payment type]_sidebar hook for adding content to the sidebar of a single payment<\\/li>\\n<li>Fix: Include the customer info with an echeck. Show the address fields in eCheck settings. When only eCheck is selected, the extra fields were not set to show or send to Authnet<\\/li>\\n<li>Fix: Replace the included SSL cert since it is causing errors on some servers<\\/li>\\n<li>Fix: Filter description shortcodes on subscriptions page<\\/li>\\n<li>Fix: Create the post (if applicable) before fields are updated<\\/li>\\n<li>Fix: Use credit card icon instead of Stripe. This will show in 3.0.<\\/li>\\n<li>Fix: Update the gateway field for better 3.0 compatibility<\\/li>\\n<\\/ul>\\n<h4>v1.01 - December 12, 2016<\\/h4>\\n<ul>\\n<li>Prevent errors when Formidable is deactivated<\\/li>\\n<li>Add frm_authnet_invoice_num hook for setting the invoice number<\\/li>\\n<li>Add a link to view the subscriptions<\\/li>\\n<li>If the subscription has failed &gt; 3 times, set it to canceled<\\/li>\\n<li>Show more error messages to a user when the payment fails<\\/li>\\n<li>Remove plugin header for nested plugin to prevent error message when activating from the plugins upload page<\\/li>\\n<li>Use the correct currency for the total on the entry sidebar instead of defaulting to USD<\\/li>\\n<li>Allow field shortcodes in description<\\/li>\\n<li>Add Indian Rupee to currency options<\\/li>\\n<li>Add table headings and subscription description to the frm-subscriptions shortcode<\\/li>\\n<li>Prevent field ids from being used as the amount<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-authorize-net\\/formidable-authorize-net.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"168468\":{\"title\":\"AWeber\",\"name\":\"AWeber\",\"slug\":\"aweber\",\"version\":\"2.01\",\"new_version\":\"2.01\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-aweber\\/formidable-aweber-2.01.zip\"],\"excerpt\":\"AWeber is a powerful email marketing service. Subscribe contacts to an AWeber mailing list when they submit your WordPress contact forms.\",\"id\":168468,\"released\":\"2013-11-26 00:00:00\",\"categories\":[\"Creator\",\"Marketing\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-aweber\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/aweber\\/\",\"changelog\":\"<h4>v2.01 - February 4, 2016<\\/h4>\\n<ul>\\n<li>Make sure the update notice doesn\'t show if the plugin is up to date<\\/li>\\n<\\/ul>\\n<h4>v2.0 - January 15, 2016<\\/h4>\\n<ul>\\n<li>Move the AWeber settings into a form action<\\/li>\\n<li>Make the plugin translatable<\\/li>\\n<li>Now it works with the free version of Formidable<\\/li>\\n<\\/ul>\\n<h4>v1.0.03 - November 13, 2015<\\/h4>\\n<ul>\\n<li>Prevent errors when Formidable is disabled<\\/li>\\n<\\/ul>\\n<h4>v1.0.02 - October 16, 2015<\\/h4>\\n<ul>\\n<li>Get updates from FormidablePro.com<\\/li>\\n<\\/ul>\\n<h4>v1.0.01 - December 2, 2013<\\/h4>\\n<ul>\\n<li>Fixed setting up lists when MailChimp add-on is not installed.<\\/li>\\n<li>Remove a hook to prevent settings from loading twice in recent versions of Formidable<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-aweber\\/formidable-aweber.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"168463\":{\"title\":\"Bootstrap\",\"name\":\"Bootstrap\",\"slug\":\"bootstrap\",\"version\":\"1.02.02\",\"new_version\":\"1.02.02\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-bootstrap\\/formidable-bootstrap-1.02.02.zip\"],\"excerpt\":\"Instantly add Bootstrap styling to all your Formidable forms.\",\"id\":168463,\"released\":\"2014-08-05 00:00:00\",\"categories\":[\"Creator\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-bootstrap\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/bootstrap\\/\",\"changelog\":\"<h4>v1.02.02 - October 9, 2017<\\/h4>\\n<ul>\\n<li>Enhancement: Allow prepend and append options with dropdowns.<\\/li>\\n<\\/ul>\\n<h4>v1.02.01 - March 8, 2017<\\/h4>\\n<ul>\\n<li>Enhancement: Update Bootstrap version to 3.3.7.<\\/li>\\n<li>Enhancement: Add prepend and append options to Lookup &gt; Text fields<\\/li>\\n<\\/ul>\\n<h4>v1.02 - December 13, 2016<\\/h4>\\n<ul>\\n<li>Enhancement: Update Bootstrap version to 3.3.6.<\\/li>\\n<li>Fix: Make sure modified [input] tag works well with Bootstrap append.<\\/li>\\n<li>Fix: Add Bootstrap ID so automatic updates work in the future.<\\/li>\\n<li>Fix: Make sure Lookup checkbox and radio fields look nice.<\\/li>\\n<\\/ul>\\n<h4>v1.01.04 - November 13, 2015<\\/h4>\\n<ul>\\n<li>Prevent errors with Formidable disabled<\\/li>\\n<\\/ul>\\n<h4>v1.01.03 - October 16, 2015<\\/h4>\\n<ul>\\n<li>Get updates from FormidablePro.com<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-bootstrap\\/formidable-bootstrap.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"185013\":{\"title\":\"Bootstrap Modal\",\"name\":\"Bootstrap Modal\",\"slug\":\"bootstrap-modal\",\"version\":\"2.0\",\"new_version\":\"2.0\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-modal\\/formidable-modal-2.0.zip\"],\"excerpt\":\"Open forms, views, other shortcodes, or sections of content in a Bootstrap popup.\",\"id\":185013,\"released\":\"2015-08-26 00:00:00\",\"categories\":[\"Creator\",\"Strategy11\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/bootstrap-modal\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/bootstrap-modal\\/\",\"changelog\":\"<h4>v2.0 - August 21, 2017<\\/h4>\\n<ul>\\n<li>Add a new shortcode format for more flexibility. Now you can include whatever you\'d like in the modal.<br \\/>\\n[ frmmodal-content]content here[\\/frmmodal-content]<\\/li>\\n<li>Add frm_modal_shortcode action hook. This is for triggering external scripts that are loaded too late when they aren\'t triggered until the footer.<\\/li>\\n<li>Add modal_class shortcode option. This will add a class to the generated modal.<\\/li>\\n<\\/ul>\\n<h4>v1.04 - April 4, 2016<\\/h4>\\n<ul>\\n<li>Allow size=small or size=large to change the modal size<\\/li>\\n<li>Add modal_title parameter to the shortcode<\\/li>\\n<li>Make sure modal works when no forms are present on the page<\\/li>\\n<li>Fix plugin URI<\\/li>\\n<\\/ul>\\n<h4>v1.03 - January 18, 2016<\\/h4>\\n<ul>\\n<li>Make sure multiple modals on a page work correctly<\\/li>\\n<\\/ul>\\n<h4>v1.02 - December 17, 2015<\\/h4>\\n<ul>\\n<li>Show an icon to close the modal<\\/li>\\n<li>Allow any shortcode to be used for the modal content. For example, use [ frmmodal type=\\\"frm-login\\\" label=\\\"Login\\\"] to show a login form when the registration plugin is active.<\\/li>\\n<li>When the license number is saved, make sure it\'s for the correct plugin<\\/li>\\n<\\/ul>\\n<h4>v1.01 - November 24, 2015<\\/h4>\\n<ul>\\n<li>Allow classes to be added to the modal link. [ frmmodal id=5 label=\\\"click here\\\" class=\\\"your classes here\\\"]<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-modal\\/formidable-modal.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"20891694\":{\"title\":\"Campaign Monitor\",\"name\":\"Campaign Monitor\",\"slug\":\"campaign-monitor\",\"version\":\"1.03\",\"new_version\":\"1.03\",\"location\":[\"fp.strategy11.com\\/releases\\/campaign-monitor\\/formidable-campaignmonitor-1.03.zip\"],\"excerpt\":\"Save time by automatically sending leads from WordPress forms to Campaign Monitor.\",\"id\":20891694,\"released\":\"2019-06-17 00:00:00\",\"categories\":[\"Business\",\"Marketing\"],\"docs\":\"\\/knowledgebase\\/campaign-monitor-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/campaign-monitor\\/\",\"changelog\":\"\",\"plugin\":\"formidable-campaignmonitor\\/formidable-campaignmonitor.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"20826884\":{\"title\":\"Constant Contact\",\"name\":\"Constant Contact\",\"slug\":\"constant-contact\",\"version\":\"1.02\",\"new_version\":\"1.02\",\"location\":[\"fp.strategy11.com\\/releases\\/constant-contact\\/formidable-constantcontact-1.02.zip\"],\"excerpt\":\"Setup WordPress forms to create leads automatically in Constant Contact. Just select a list and match up form fields.\",\"id\":20826884,\"released\":\"2018-10-15 00:00:00\",\"categories\":[\"Business\",\"Marketing\"],\"docs\":\"\\/knowledgebase\\/constant-contact-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/constant-contact\\/\",\"changelog\":\"<h4>v1.02 - December 12, 2019<\\/h4>\\n<ul>\\n<li>New: Make authenticating easier<\\/li>\\n<li>Show more helpful error messages in the global settings and in the form action<\\/li>\\n<li>Use icon instead of image for form action<\\/li>\\n<li>Update form action layout to match v4.0<\\/li>\\n<li>Remove debug mode in favor of logging<\\/li>\\n<li>Fix: When different forms are used to update a contact, only the most recent info was saved and previous values were removed (ie custom fields, selected lists)<\\/li>\\n<li>Fix: If a contact was deleted in Constant Contact, it was causing a failure when updating the contact from Formidable<\\/li>\\n<\\/ul>\\n<h4>v1.01 - October 31, 2018<\\/h4>\\n<ul>\\n<li>Fix: On first install, the Global settings page was not loaded correctly<\\/li>\\n<li>Fix: Allow the debug mode checkbox to be unchecked<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-constantcontact\\/formidable-constantcontact.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"20247260\":{\"title\":\"Datepicker Options\",\"name\":\"Datepicker Options\",\"slug\":\"datepicker-options\",\"version\":\"1.01\",\"new_version\":\"1.01\",\"location\":[\"fp.strategy11.com\\/releases\\/dates\\/formidable-dates-1.01.zip\"],\"excerpt\":\"Add more options to date fields in your forms for so only the dates you choose can be chosen.\",\"id\":20247260,\"released\":\"2018-07-30 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/datepicker-options\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/datepicker-options\\/\",\"changelog\":\"<h4>v1.01 - June 18, 2020<\\/h4>\\n<ul>\\n<li>When one field depends on another for the min or max date, set it immediately even if the first field doesn\'t have extra datepicker settings.<\\/li>\\n<li>Fix: The inline datepicker wasn\'t always being displayed depending on the settings.<\\/li>\\n<li>Fix: Use the correct start and end years if the years setting is different from the min and max dates.<\\/li>\\n<li>Fix: More reliably set the minimum and maximum dates.<\\/li>\\n<li>Fix: If a minimum date is set don\'t force it for the default date.<\\/li>\\n<li>Fix: A PHP error that was showing when a field had no settings saved.<\\/li>\\n<\\/ul>\\n<h4>v1.0.04 - June 10, 2019<\\/h4>\\n<ul>\\n<li>Fix: Inline datepickers were selecting a default date that wasn\'t allowed with some configurations<\\/li>\\n<li>Fix: Settings to select days of the week weren\'t appearing up in 4.0.<\\/li>\\n<li>Cleanup settings for 4.0<\\/li>\\n<\\/ul>\\n<h4>v1.0.03 - March 18, 2019<\\/h4>\\n<ul>\\n<li>Add minimized js and add pot file.<\\/li>\\n<li>Fix the datepicker appearance in backend settings when the front-end Formidable css is not loaded.<\\/li>\\n<li>Fix error when Formidable Forms is disabled.<\\/li>\\n<\\/ul>\\n<h4>v1.0.02 - October 15, 2018<\\/h4>\\n<ul>\\n<li>Fix: Exceptions couldn\'t be added in repeating date fields<\\/li>\\n<li>Fix: Show inline datepickers when creating or editing an entry on the backend<\\/li>\\n<li>Fix: Inline datepickers were always defaulting to today\'s date<\\/li>\\n<\\/ul>\\n<h4>v1.0.01 - August 6, 2018<\\/h4>\\n<ul>\\n<li>Fix: Load the datepicker javascript when SCRIPT_DEBUG is not enabled<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-dates\\/formidable-dates.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"26596685\":{\"title\":\"Directory\",\"name\":\"Directory\",\"slug\":\"directory\",\"version\":\"1.0\",\"new_version\":\"1.0\",\"location\":[\"fp.strategy11.com\\/releases\\/directory\\/formidable-directory-1.0.zip\"],\"excerpt\":\"Get an instant business, team, or member directory. Choose a layout, select a page, and you\'re done.\",\"id\":26596685,\"released\":\"2020-06-29 00:00:00\",\"categories\":[\"Solution\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/formidable-directory\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/wordpress-directory-plugin\\/\",\"changelog\":\"\",\"plugin\":\"formidable-directory\\/formidable-directory.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"beta\":{\"version\":\"100\",\"location\":[\"fp.strategy11.com\\/form-templates\\/business-directory.xml\"]},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"20897348\":{\"title\":\"Export View to CSV\",\"name\":\"Export View to CSV\",\"slug\":\"export-view\",\"version\":\"1.02\",\"new_version\":\"1.02\",\"location\":[\"fp.strategy11.com\\/releases\\/export-view\\/formidable-export-view-1.02.zip\"],\"excerpt\":\"Easily create custom CSV files and allow users to export their data from the front-end of your site.\",\"id\":20897348,\"released\":\"2019-08-01 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/table-view-to-csv\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/export-view\\/\",\"changelog\":\"<p>No Changes Found<\\/p>\\n\",\"plugin\":\"formidable-export-view\\/formidable-export-view.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"326042\":{\"title\":\"Form Action Automation\",\"name\":\"Form Action Automation\",\"slug\":\"autoresponder\",\"version\":\"2.03\",\"new_version\":\"2.03\",\"location\":[\"fp.strategy11.com\\/releases\\/autoresponder\\/formidable-autoresponder-2.03.zip\"],\"excerpt\":\"Schedule email notifications, SMS messages, and API actions.\",\"id\":326042,\"released\":\"2016-09-21 00:00:00\",\"categories\":[\"Elite\",\"Marketing\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/schedule-autoresponder\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/autoresponder\\/\",\"changelog\":\"<h4>v2.03 - May 30, 2019<\\/h4>\\n<ul>\\n<li>Update the settings layout a bit for Formidable v4.0<\\/li>\\n<li>Code: Add automation for plugin releases<\\/li>\\n<li>Code: Update for better WordPress code styling<\\/li>\\n<\\/ul>\\n<h4>v2.02 - November 7, 2018<\\/h4>\\n<ul>\\n<li>New: Allow user registration to be scheduled with the automation settings<\\/li>\\n<li>Fix: When a form action is disabled, don\'t trigger it with the automation<\\/li>\\n<\\/ul>\\n<h4>v2.01 - August 1, 2018<\\/h4>\\n<ul>\\n<li>Fix: Replace __DIR__ for php 5.2 support<\\/li>\\n<li>Fix: Prevent php warning with empty dates<\\/li>\\n<li>Fix: Switch to non-deprecated save_settings function<\\/li>\\n<li>A bunch of codestyling changes, messages for translators, and escape translated strings<\\/li>\\n<\\/ul>\\n<h4>v2.0 - September 18, 2017<\\/h4>\\n<ul>\\n<li>New: Trigger automation by date + time when time fields are included in the form<\\/li>\\n<li>Tweak: Add entry and action to frm_autoresponder_time hook<\\/li>\\n<li>Tweak: Change naming to Automation instead of Autoresponder to indicate expanded functionality<\\/li>\\n<li>Tweak: Large refactoring in the code behind the scenes<\\/li>\\n<li>Fix: Show the queued time in the current site timezone<\\/li>\\n<li>Fix: Remove queued events when an entry is deleted<\\/li>\\n<\\/ul>\\n<h4>v1.04 - October 12, 2016<\\/h4>\\n<ul>\\n<li>Add logic to stop scheduled events when the form action logic is not met<\\/li>\\n<li>Automatically update the queue times when an entry is updated<\\/li>\\n<li>Only show countdown on the debug queue if the trigger will be happening within the next 3 days<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-autoresponder\\/formidable-autoresponder.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"168072\":{\"title\":\"Formidable API\",\"name\":\"Formidable API\",\"slug\":\"formidable-api\",\"version\":\"1.08\",\"new_version\":\"1.08\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-api\\/formidable-api-1.08.zip\"],\"excerpt\":\"Add a full forms API for forms, form fields, views, and entries. Then send submissions to other sites with REST APIs.\",\"id\":168072,\"released\":\"2016-06-08 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-api\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/formidable-api\\/\",\"changelog\":\"<h4>v1.08 - May 27, 2019<\\/h4>\\n<ul>\\n<li>New: Add exclude_script and exclude_style parameters to the frm-api shortcode for excluding specific styles and scripts.<\\/li>\\n<li>New: When using the frm-api shortcode, scripts included on the page will be automatically excluded to prevent duplication.<\\/li>\\n<li>Don\'t allow GET access to field routes for those who don\'t have access to view forms on the back end.<\\/li>\\n<li>Switch shortcodes in data settings when form is duplicated.<\\/li>\\n<li>Fix: Javascript was not included with views, so shortcodes like frm-entry-update-field did not respond.<\\/li>\\n<li>Fix: Clicking the + row button quickly was creating duplicate rows.<\\/li>\\n<li>Fix: The ... was missing in 4.0 for newly added data rows. This fix requires Formidable v4.0.02<\\/li>\\n<\\/ul>\\n<h4>v1.07 - December 26, 2018<\\/h4>\\n<ul>\\n<li>Fix: multiple files were not correctly attached to the created entry<\\/li>\\n<li>Fix: when a file was created via the API, it was being duplicated on the receiving end<\\/li>\\n<li>Fix: When the API plugin is active, and Formidable is not, there was an error when creating a new page with the new WP editor<\\/li>\\n<\\/ul>\\n<h4>v1.06 - October 8, 2018<\\/h4>\\n<ul>\\n<li>New: Add image importing via the REST API. Now an image can be uploaded from another site when the URL is included in the API request.<\\/li>\\n<li>Fix: Prevent CORS error with ajax calls. This resolves issues with double submissions, redirecting with validation errors, and adding rows in a repeater.<\\/li>\\n<li>Fix: The returned form object was different after a form was edited than after create or get.<\\/li>\\n<\\/ul>\\n<h4>v1.05.01 - August 22, 2018<\\/h4>\\n<ul>\\n<li>Fix issue with file fields not saving the received value<\\/li>\\n<\\/ul>\\n<h4>v1.05 - July 27, 2018<\\/h4>\\n<ul>\\n<li>New: Add start_date and end_date parameters to filter the route to get entries<\\/li>\\n<li>Fix: Add better functionality to the search parameter in the route to get entries<\\/li>\\n<li>Fix: Allow the registration validation to trigger during API call<\\/li>\\n<li>Fix: reCaptcha was returning an error when creating an entry<\\/li>\\n<li>Fix: Creating an entry that included dynamic fields was causing a fatal error by using deprecated functions<\\/li>\\n<li>Fix: The route to create a form wasn\'t working correctly<\\/li>\\n<li>Remove old sslverify =&gt; false lines since they are no longer recommended<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-api\\/formidable-api.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"20834175\":{\"title\":\"Formidable Payments\",\"name\":\"Formidable Payments\",\"slug\":\"formidable-payments\",\"version\":\"1.14\",\"new_version\":\"1.14\",\"location\":[\"fp.strategy11.com\\/releases\\/payments\\/formidable-payments-1.14.zip\"],\"excerpt\":\"\",\"id\":20834175,\"released\":\"2018-11-06 12:08:25\",\"categories\":[],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/formidable-payments\\/\",\"changelog\":\"\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"93790\":{\"title\":\"Formidable Pro\",\"name\":\"Formidable Pro\",\"slug\":\"formidable-pro\",\"version\":\"4.07.01\",\"new_version\":\"4.07.01\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-pro-4.07.01.zip\"],\"excerpt\":\"\",\"id\":93790,\"released\":\"2010-02-01 16:27:26\",\"categories\":[\"Personal\",\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/formidable-pro\\/\",\"changelog\":\"<h4>v4.07.01 - September 14, 2020<\\/h4>\\n<ul>\\n<li>Show any views for repeaters on the view listing page for the parent form.<\\/li>\\n<li>Added javascript validation on URL fields.<\\/li>\\n<li>Fix: Preserve Dynamic field, Lookup, calculations, etc regardless of the field order<\\/li>\\n<li>Fix: A Rich Text Field in a repeater didn\'t repeat field with tool bar.<\\/li>\\n<li>Fix: When the button to Delete all entries is used, it was possible to delete the entries a second time if the page was reloaded.<\\/li>\\n<li>Fix: The currency format wasn\'t always used for calculated fields in emails.<\\/li>\\n<li>Fix: When javascript validation is turned on, show an error message for file upload fields.<\\/li>\\n<li>Fix: File Upload fields weren\'t fully accessible with the label.<\\/li>\\n<li>Fix: The multiselect role options weren\'t sreen-reader friendly.<\\/li>\\n<li>Fix: Some characters in displayed lookup values were displayed as HTML entities like &gt;<\\/li>\\n<li>Security: Restrict access to plugin PHP files when accessed directly in the browser.<\\/li>\\n<\\/ul>\\n<h4>v4.07 - August 26, 2020<\\/h4>\\n<ul>\\n<li>New: Multiple roles can now be selected in each of the role options. This allows for more control when using custom roles.<\\/li>\\n<li>Fix: reCaptchas are now more reliable for ajax and multi-paged forms.<\\/li>\\n<\\/ul>\\n<h4>v4.06.03 - August 12, 2020<\\/h4>\\n<ul>\\n<li>New: Better handle importing options with commas. Options can be in a single column in the CSV with commas, or each option can be in a separate column.<\\/li>\\n<li>Fix: Hidden fields with default values within repeaters lost value when repeater was hidden\\/unhidden.<\\/li>\\n<li>Fix: Conditional logic based on default values wasn\'t working on page 2+ within a repeating section.<\\/li>\\n<li>Fix: Default values in checkbox fields with conditional logic we getting cleared.<\\/li>\\n<\\/ul>\\n<h4>v4.06.02 - July 30, 2020<\\/h4>\\n<ul>\\n<li>New: Added an option to attach a file to sent emails.<\\/li>\\n<li>New: Added responsive classes for use in views: frm_no_grid_750 and frm_no_grid_600.<\\/li>\\n<li>New: Allow account connection from the add-ons page to reduce clicks.<\\/li>\\n<li>New: Added frm_action_logic_value hook for changing the value saved for form action logic.<\\/li>\\n<li>New: Added frm_field_object_for_shortcode hook used when showing field values in views and emails.<\\/li>\\n<li>Update the frm-search shortcode to include block classes for themes to style.<\\/li>\\n<li>Improved the styling for the frm-alt-table class.<\\/li>\\n<li>Fix: Images in radio fields and start ratings weren\'t keyboard accessible.<\\/li>\\n<li>Fix: Images in radio buttons can now be centered.<\\/li>\\n<li>Fix: Calculated currency values weren\'t showing on edit.<\\/li>\\n<li>Fix: Some form actions were triggered during XML import when they shouldn\'t have.<\\/li>\\n<li>Fix: Don\'t show error message for Total field when it\'s hidden with conditional logic.<\\/li>\\n<\\/ul>\\n<h4>v4.06.01 - July 16, 2020<\\/h4>\\n<ul>\\n<li>New: Use line_breaks=0 to show multi-line content in one row inside the frm-show-entry shortcode.<\\/li>\\n<li>New: Add format=currency option for use with field shortcodes<\\/li>\\n<li>New: Calculated currency values will now show as currency when the value is displayed. This covers summaries, emails, entry listing page, views and more.  To prevent this formatting, use format=number in the field shortcode.<\\/li>\\n<li>New: Add settings for inbox messages.<\\/li>\\n<li>Fix: Correctly show a numeric value in a dynamic list field on the view entry page and in emails.<\\/li>\\n<li>Fix: Prevent javascript error when submit button is inline with no visible fields.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-pro\\/formidable-pro.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-772x250.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"20896934\":{\"title\":\"Formidable Pro Basic\",\"name\":\"Formidable Pro Basic\",\"slug\":\"formidable-basic\",\"version\":\"\",\"new_version\":\"\",\"location\":[],\"excerpt\":\"\",\"id\":20896934,\"released\":\"2019-07-22 09:03:39\",\"categories\":[\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/formidable-basic\\/\",\"changelog\":\"\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"expires\":\"\",\"code\":\"\",\"date\":\"\",\"type\":\"free\"},\"19366995\":{\"title\":\"Formidable Pro Business Package\",\"name\":\"Formidable Pro Business Package\",\"slug\":\"formidable-pro-small-business-package\",\"version\":\"\",\"new_version\":\"\",\"location\":[],\"excerpt\":\"\",\"id\":19366995,\"released\":\"