(25, 1, '2020-09-30 09:32:31', '2020-09-30 09:32:31', '<!-- wp:paragraph -->\n<p>This privacy policy discloses the privacy practices for (Kanvan Sports powered by Kanvan Business Solutions Pvt Ltd). This privacy policy applies solely to information collected by this web site. It will notify you of the following:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:wpforms/form-selector {\"formId\":\"79\"} /-->\n\n<!-- wp:paragraph -->\n<p>We are the sole owners of the information collected on this site. We only have access to/collect information that you voluntarily give us via email or other direct contact from you. We will not sell or rent this information to anyone.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Unless you ask us not to, we may contact you via email in the future to tell you about specials, new products or services, or changes to this privacy policy.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"align\":\"left\",\"level\":4} -->\n<h4 class=\"has-text-align-left\">YOUR ACCESS TO AND CONTROL OVER THIS INFORMATION</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>You may opt out of any future contacts from us at any time. You can do the following at any time by contacting us via the email address or phone number given on our website:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:wpforms/form-selector {\"formId\":\"81\"} /-->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>SECURITY</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>We take precautions to protect your information. When you submit sensitive information via the website, your information is protected both online and offline.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Wherever we collect sensitive information (such as credit card data or any financial data, personal details, medical conditions etc ), that information is encrypted and transmitted to us in a secure way. You can verify this by looking for a closed lock icon at the bottom of your web browser, or looking for \"https\" at the beginning of the address of the web page.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>While we use encryption to protect sensitive information transmitted online, we also protect your information offline. Only employees who need the information to perform a specific job (for example, billing or customer service) are granted access to personally identifiable information. The computers/servers in which we store personally identifiable information are kept in a secure environment.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Fee &amp; Charges.</h4>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Fee will be Rs 1000 per client per month for individuals.</li><li>Monthly Family package – Rs -3200/month for husband &amp; wife with two kids above age 5 but below age 15. If have one kid then Rs-2500 included parents &amp; if only husband &amp; wife – Rs 1700</li><li>Quarterly Fee of Individuals- Rs 3200 &amp; Family package –Rs 9000</li><li>Half Yearly fee of Individuals- Rs 5900 &amp; Family Package- Rs-15000</li><li>Yearly fee of Individuals- Rs 9500 &amp; Family Package- Rs- 25000</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>UPDATES</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Our Privacy Policy may change from time to time and all updates will be posted on this page.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you feel that we are not abiding by this privacy policy, you should contact us immediately via telephone at 9871587820 or via email at- info@kanvan.in</p>\n<!-- /wp:paragraph -->', 'Privacy Policy', '', 'publish', 'closed', 'closed', '', 'contact-us', '', '', '2020-09-30 13:23:13', '2020-09-30 13:23:13', '', 0, 'http://localhost/mayank/kanvan-sports/?page_id=25', 0, 'page', '', 0),
