(112, 1, '2020-10-03 07:32:20', '2020-10-03 07:32:20', '<!-- wp:heading {\"level\":3} -->\n<h3><strong>PERSONAL TRAINING CONTRACT / AGREEMENT</strong></h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Congratulations on your decision to improve your health by participating in a professional exercise program!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>With the help of our Fitness trainer, you greatly improve your ability to accomplish your training goals faster, safer, and with maximum benefits. The education you will learn during these training sessions can be used for a lifetime.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In order to maximize progress, it will be necessary for you to follow program guidelines during supervised and, if applicable, unsupervised training days. Remember, exercise and healthy eating are EQUALLY important!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In order to maximize progress, it will be necessary for you to follow program guidelines during supervised and, if applicable, unsupervised training days. Remember, exercise and healthy eating are EQUALLY important!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>TRAINING TERMS &amp; CONDITIONS:</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">1.Kanvan Fitness Trainer or Personal training sessions that are not rescheduled or cancelled 24 hours in advance will result in forfeiture of the session and a loss of the financial investment at the rate of one session.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">2.Clients arriving late will receive the remaining scheduled session time, unless other arrangements have been previously made with the trainer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">3.No personal &amp; group &nbsp;training r