(129, 1, '2020-10-03 10:59:40', '2020-10-03 10:59:40', '<!-- wp:heading -->\n<h2><strong>ASSUMPTION OF RISK, WAIVER AND RELEASE OF LIABILITY, AND INDEMNITY AGREEMENT</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong>DECLARATIONS:</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This Agreement is entered into between Kanvan Sports</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p> (“FitnessTrainer”) and the undersigned (“Client”). The provision of personal training services by Trainer to Client, and Client’s use of any premises, facilities or equipment are contingent upon this Agreement.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3><strong>ASSUMPTION OF RISK:</strong></h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>You agree that if you engage in any physical exercise or activity, including personal training, or enter our premises or use any facility or equipment on our premises for any purpose, you do so at your own risk and assume the risk of any and all injury and/or damage you may suffer, whether while engaging in physical exercise or not. This includes injury or damage sustained while and/or resulting from using any premises or facility, or using any equipment, whether provided to you by Trainer or otherwise, including injuries or damages arising out of the negligence of Trainer, whether active or passive, or any of Trainer’s affiliates, employees, agents, representatives, successors, and assigns.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Your assumption of risk includes, but is not limited to, your use of any exercise equipment (mechanical or otherwise), sports fields, courts, or other areas, locker rooms, sidewalks, parking lots, stairs, pools, whirlpools, saunas, steam rooms, lobby or other general areas of any facilities, or any equipment.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You assume the risk of your participation in any activity, class, program, instruction, or event, including but not limited to weightlifting, walking, jogging, running, aerobic activities, aquatic activities, tennis, basketball, volleyball, racquetball, or any other sporting or recreational endeavor.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You agree that you are voluntarily participating in the aforementioned activities and assume all risk of injury, illness, damage, or loss to you or your property that might result, including, without limitation, any loss or theft of any personal property, whether arising out of the negligence of Trainer or otherwise.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5><strong>RELEASE:</strong></h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>You agree on behalf of yourself (and all your personal representatives, heirs, executors, administrators, agents, and assigns) to release and discharge Trainer (and Trainer’s affiliates, related entities, employees, agents, representatives, successors, and assigns) from any and all claims or causes of action (known or unknown) arising out of the negligence of Trainer, whether active or passive, or any of Trainer’s affiliates, employees, agents, representatives, successors, and assigns.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This waiver and release of liability includes, without limitation, injuries which may occur as a result of (a) your use of any exercise equipment or facilities which may malfunction or break, (b) improper maintenance of any exercise equipment.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>premises or facilities, (c) negligent instruction or supervision, including personal training, (d) negligent hiring or retention of employees, and/or (e) slipping or tripping and falling while on any portion of a premises or while traveling to or from personal training, including injuries resulting from Trainer’s or anyone else’s negligent inspection or maintenance of the facility or premises.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>INDEMNIFICATION:</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>By execution of this agreement, you hereby agree to indemnify and hold harmless Trainer from any loss, liability, damage, or cost Trainer may incur due to the provision of personal training by Trainer to you.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>ACKNOWLEDGMENTS:</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You expressly agree that the foregoing release, waiver, assumption of risk and indemnity agreement is intended to be as broad and inclusive as permitted by the law in the State of California and that if any portion thereof is held invalid, it is agreed that the balance shall, notwithstanding, continue in full legal force and effect.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You acknowledge that Trainer offers a service to his/her clients encompassing the entire recreational and/or fitness spectrum. Trainer is not in the business of selling weightlifting equipment, exercise equipment, or other such products to the public, and the use of such items is incidental to the service provided by Trainer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You acknowledge and agree that Trainer does not place such items into the stream of commerce. This release is not intended as an attempted release of claims of gross negligence or intentional acts. You acknowledge that you have carefully read this waiver and release and fully understand that it is a release of liability, express assumption of risk and indemnity agreement.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You are aware and agree that by executing this waiver and release, you are giving up your right to bring a legal action or assert a claim against trainer for trainer’s negligence, or for any defective product used while receiving personal training from trainer. You have read and voluntarily signed the waiver and release and further agree that no oral representations, statements, or inducement apart from the foregoing written agreement have been made.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'page-5', '', 'inherit', 'closed', 'closed', '', '124-revision-v1', '', '', '2020-10-03 10:59:40', '2020-10-03 10:59:40', '', 124, 'http://localhost/mayank/kanvan-sports/2020/10/03/124-revision-v1/', 0, 'revision', '', 0),
