(202, 1, '2020-10-05 08:54:56', '2020-10-05 08:54:56', '<!-- wp:heading {\"level\":3} -->\n<h3><strong>LET’SBUILDANAMAZINGFITNESSCOMMUNITY:PLUS-­‐TWO</strong></h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>We want to build an awesome fitness community here, so we’re asking for your input. Who are your “Plus-­‐Two” friends, family, co-­‐workers, or neighbors who could benefit from personal training?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Your two referrals (a.k.a. your “Plus-­‐Two”) will each receive a FREE transformation coaching session for 3 days where Kanvan Sports will help them outline their goals and a path to get there.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>So, who comes to mind when you think of your Plus-­‐Two?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:ninja-forms/form {\"formID\":5,\"formTitle\":\"Feedback\"} /-->', 'policy page', '', 'inherit', 'closed', 'closed', '', '113-autosave-v1', '', '', '2020-10-05 08:54:56', '2020-10-05 08:54:56', '', 113, 'http://localhost/mayank/kanvan-sports/2020/10/05/113-autosave-v1/', 0, 'revision', '', 0),
(203, 1, '2020-10-05 08:56:52', '2020-10-05 08:56:52', '<!-- wp:heading {\"level\":3} -->\n<h3><strong>PERSONAL TRAINING CONTRACT / AGREEMENT</strong></h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Congratulations on your decision to improve your health by participating in a professional exercise program!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>With the help of our Fitness trainer, you greatly improve your ability to accomplish your training goals faster, safer, and with maximum benefits. The education you will learn during these training sessions can be used for a lifetime.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In order to maximize progress, it will be necessary for you to follow program guidelines during supervised and, if applicable, unsupervised training days. Remember, exercise and healthy eating are EQUALLY important!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In order to maximize progress, it will be necessary for you to follow program guidelines during supervised and, if applicable, unsupervised training days. Remember, exercise and healthy eating are EQUALLY important!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>TRAINING TERMS &amp; CONDITIONS:</h4>\n<!-- /wp:heading -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li>Kanvan Fitness Trainer or Personal training sessions that are not rescheduled or cancelled 24 hours in advance will result in forfeiture of the session and a loss of the financial investment at the rate of one session.</li><li>Clients arriving late will receive the remaining scheduled session time, unless other arrangements have been previously made with the trainer.</li><li>No personal &amp; group &nbsp;training refunds will be issued for any reason, including but not limited to relocation, illness, and unused sessions.</li></ol>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:wpforms/form-selector {\"formId\":\"110\"} /-->\n\n<!-- wp:paragraph -->\n<p>WE ARE EXCITED TO BEGIN WORKING WITH YOU!</p>\n<!-- /wp:paragraph -->', 'Term & Condition', '', 'inherit', 'closed', 'closed', '', '102-revision-v1', '', '', '2020-10-05 08:56:52', '2020-10-05 08:56:52', '', 102, 'http://localhost/mayank/kanvan-sports/2020/10/05/102-revision-v1/', 0, 'revision', '', 0),
